                "may_october": "May / October",
                "minivan_tours": "Minivan Tours",
                "adventure_quad": "Adventure Quad",
                "adventure_quad_desc": "Experience the adventurous quad ride through the stunning Primošten landscape that hides a handful of interesting local stories.",
                "airport_transfers_desc": "We look forward to your arrival! Choose our reliable in-house airport transfers or popular minivan tours.",
                "rent_a_car_desc": "Buckle up and start your road-trip adventure! Explore the sunny Dalmatian coast with our partner rental cars.",
                "rent_a_boat_desc": "Want to avoid the summer temperatures and the crowds of tourists? Rent a boat at a special price and sail away!",
                "minivan_tours_desc": "Get to know and love the beautiful holiday region with adriana-travel. An\n\t\tunforgettable experience!",
                "rogo_split": "Rogoznica - Split airport",
                "rogo_zadar": "Rogoznica - Zadar airport",
                "airport_transfers_descin": "We’ll make sure you will get to your holiday doorstep and back with a smile. Enjoy our airport transfers service.",
