                "rogoznica": "Rogoznica",
                "rent_a_boat_main": "Boost your summer holiday, charter a boat and start exploring!",
                "rent_a_boat_sub": "Choose our boat transfers and sail away on island hopping getaway!",
                "welcome_to_our_modern_sporty": "Welcome to our modern sporty motorboat which has great maritime characteristics and it is very stable at sea. Boat is well equipped and it has everything you need for your dream vacation! It can fit up to 7 people and it is ready to be taken out on Adriatic Sea.As of this year, the ship has a new Yamaha 115 Hp engine, which is very environmentally friendly and with lower fuel consumption. It also has a new bimini, shower and radio.",
                "it_is_situated_in_the_beautiful_bay_between": "It is situated in the beautiful bay between Rogoznica and Marina, the bay name is Sičenica. In our bay, where the boat is on the berth, you have free parking.\n\t\tIn our area, there are a lot of great and interesting things and places to visit, as Trogir, Rogoznica, Sevid, Punta Planka, Lighthouse Mulo, Smokvica, Dragon´s eye lake...\n\t\tWith our boat, you can visit many beautiful bays like Stari Trogir, Borovica, Ražanj, Rogoznica and islands such as Drvenik, Šolta, Čiovo, Brač, Žirje, ecc.",
                "if_you_dont_have_any_nautical_knowledge": "If you don't have any nautical knowledge or licence you don't have to be worried because we can offer you one of our professional skipper and price is 100 euro per day.",
