                "where": "Gdje se nalazi?",
                "where_desc": "Smješten u skrivenoj uvali i zaklonjen od vjetra, gradić Rogoznica i njegovih 50 kilometara netaknute obale, nautički su raj sa savršenom klimom, zadivljujućim plažama, sjenovitim borovim šumama i prirodnim fenomenom - slanim jezerom Zmajevo oko koje skriva karakterističnu floru i faunu.",
