                "zadar_desc01": "Zadar će vas očarati svojim kamenim ulicama i povijesnim znamenitostima danju, te živim barovima i restoranima noću. A jesmo li spomenuli zalaske sunca koji kao da su s drugog svijeta? Dodamo li tome i raznovrsnu ponudu plaža te mnoge parkove prirode i nacionalne parkove u neposrednoj blizini, ne čudi što je Zadar omilljena destinacija za posjetitelje svih generacija.",
                "zadar_desc02": "Dok ste u Zadru, posjetite 27m visoku i 22m široku crkvu Svetog Donata;  počastite se sladoledom i prošećite glavnom šetnicom Kalelargom; poslušajte muziku koju proizvode jedinstvene Morske orgulje; uživajte u svjetlosnoj predstavi koju proizvodi solarna instalacija Pozdrav suncu; kušajte originalni liker Maraskino koji se radi od autohtone vrste višanja.",
