                "dubrovnik_desc02": "Svjetski poznat i obožavan zbog svoje zadivljujuće obalne lokacije, povijesnog starog grada čija ljepota zaustavlja dah te brojnih otmjenih restorana, veličanstveni Dubrovnik je jedno od onih mjesta iz kojih nikad ne želite otići.",
